import React from "react";
import './popup.css'

const Popup = (props) => {
const {id, thumbnailUrl, title} = props
    return(
            <li key={`key${id}`} className="popup-li collection-item avatar">
                <img src={thumbnailUrl} alt="" class="circle"></img>
                <p className="black-text"><strong className="label">Title: </strong>{title}</p>
                <p className="black-text"><strong className="label">count: </strong>{id}</p>
            </li>
    )
}

export default Popup;
